    return (
      <div className="navbar">
        <div className="navbar__search">
          <SearchIcon style={{ color: "#8c9096", fontSize: "3vh" }} />
          <input type="text" placeholder="Search on Vivid" />
        </div>
        <div className="navbar__user">
          <Avatar style = {{height: "3vh",}} />
          <h3>Hey, Ugurcan PZ !</h3>
        </div>
      </div>
    );
}

export default NavBar
